<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>MathJax </b>est une bibliothèque <b>JavaScript </b>multi-navigateurs qui affiche la notation mathématique dans les navigateurs Web, en utilisant le balisage MathML, LaTeX et AsciiMathML.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="installation-de-mathjax-v3-2-2">Installation de MathJax v3.2.2</a>
</h1>
<div class="Section6"><br>Nous essayerons d'installer MathJax dans notre environnement de développement. Ouvrir la page de téléchargement. Ouvrir le page des tags.&nbsp;Télécharger le fichier archive. Décompresser le fichier archive. Installer le fichier décompressé dans votre environnement de développement selon votre choix (/libs/mathjax/v3.2.2/es5/).<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
