<h1 class="Section4">
<a class="Section5" href="#" id="utilisation-de-mathjax-v3-2-2">Utilisation de MathJax v3.2.2</a>
</h1>
<div class="Section6"><br>Nous essayerons d'afficher la solution d'une équation du second degré. Ouvrir un éditeur de texte selon votre choix (Notepad++). Editer le programme HTML. Afficher la page dans un navigateur web selon votre choix (Google Chrome).<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#utilisation-de-mathjax_ce-qu-il-faut-savoir">Ce qu'il faut savoir</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
