</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-mathjax_ce-qu-il-faut-savoir" href="#utilisation-de-mathjax-v3-2-2">Ce qu'il faut savoir</a>
</h2><br>Il faut que votre dossier d'installation soit à la racine de votre fichier d'entrée (index.html).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-mathjax_programme-principal" href="#utilisation-de-mathjax-v3-2-2">Programme principal</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="html" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">&lt;!DOCTYPE html&gt;
&lt;html lang="fr"&gt;
    &lt;head&gt;
        &lt;title&gt;MathJax | ReadyDev&lt;/title&gt;
        &lt;style&gt;
            .editor {
                display: inline-block;
                border: 1px solid black;
                padding: 10px;
                font-size: 16px;
            }
        &lt;/style&gt;
    &lt;/head&gt;
    &lt;body&gt;
        &lt;div class="editor"&gt;\[x = {-b \pm \sqrt{b^2-4ac} \over 2a}\]&lt;/div&gt;
        &lt;script src="./libs/mathjax/v3.2.2/es5/tex-mml-chtml.js"&gt;&lt;/script&gt;
    &lt;/body&gt;
&lt;/html&gt;</pre><br><h2 class="GTitle1 Title1">
